    public void parseDE72(String de72string, AppDatabase database) {
        //slipting to Data Record Header
        //    String dataRecordHeader = de72.substring(7, 21);

        //       d72 = "";
//        d72 = "";
//        String de72string = ByteConversionUtils.convertHexToString(d72);
        Logger.v("De72 : " + de72string);


//        List<String> gsList = Arrays.asList(de72string.split("\u001D"));
//        List<String> gsList = Arrays.asList(de72string.split("<GS>"));
        List<String> gsList = Arrays.asList(de72string.split("\u001D"));

        Logger.v("De72 list size:" + gsList.size());

        String header = gsList.get(0);
        Logger.v("De72 header: ", header);

        String downloadType = header.substring(0, 3);
        Logger.v("De72 downloadType: " + header);
        if (downloadType.equalsIgnoreCase("306")) {
            partialDownload = false;
            if (header.substring(3, 5).equalsIgnoreCase("01")) {
                AppManager.getInstance().initializationStatus(2);
                clearDatabase(database);
            }
        }

        for (int i = 1; i < gsList.size(); i++) {

//            List<String> fsList = new ArrayList<String>(Arrays.asList(gsList.get(i) +" ".split("\u001C")));
//            String type = fsList.get(0);
            String dataType = gsList.get(i).trim().substring(0, 3);
//            List<String> fsList = Arrays.asList((gsList.get(i) + " ").split("\u001C"));
//            List<String> fsList = Arrays.asList((gsList.get(i) + " ").split("<FS>"));
            List<String> fsList = Arrays.asList((gsList.get(i) + " ").split("\u001C"));


            Logger.v("Packet -- " + gsList.get(i));
            Logger.v("Packet -- " + fsList.get(0));
            Logger.v("De72 dataType: " + dataType);
//            String dataTypeName = getDataType(dataType);
            saveIntoSegment(dataType, fsList, database);
        }

    }

    private void clearDatabase(AppDatabase database) {
        database.getAIDDataDao().nukeTable();
        database.getTMSMessageTextDao().nukeTable();
        database.getSAFDao().nukeTable();
        database.getTMSPublicKeyModelDao().nukeTable();
        database.getTransactionDao().nukeTable();
        database.getTMSCardSchemeDao().nukeTable();
    }

    private void parsePublicKeySegment(List<String> fsList, AppDatabase database) {
        //adding extra space for split the string
//        String seg1 = s + " ";
//        List<String> fsList = Arrays.asList(seg1.split("\u001C"));
        Log.i("De72 segment1: -041 ", fsList.size() + "");
        TMSPublicKeyModelEntity tmsPublicKeyModelEntity = new TMSPublicKeyModelEntity();
        tmsPublicKeyModelEntity.setRID(fsList.get(0).substring(3).trim());
        tmsPublicKeyModelEntity.setKeyIndex(fsList.get(1).trim());
        tmsPublicKeyModelEntity.setHashId(fsList.get(2).trim());
        tmsPublicKeyModelEntity.setDigitalSignatureId(fsList.get(3).trim());
        tmsPublicKeyModelEntity.setPublicKey(fsList.get(4).trim());
        tmsPublicKeyModelEntity.setExponent((fsList.get(5).trim().length() == 1)?"0"+fsList.get(5).trim():fsList.get(5).trim());
        tmsPublicKeyModelEntity.setCheckSum(fsList.get(6).trim());
        tmsPublicKeyModelEntity.setCaPublicKeyLength(fsList.get(7).trim());
        tmsPublicKeyModelEntity.setCaPublicKeyExpiryDate(fsList.get(8).trim());
        database.getTMSPublicKeyModelDao().insertTMSPublicKey(tmsPublicKeyModelEntity);

    }

    public void saveIntoSegment(String dataType, List<String> fsList, AppDatabase database) {
        Logger.v("responce---dataType-" + dataType);
        switch (dataType) {
            case "011":
                RetailerDataParser.parseRDTDataSegment1(fsList);
                break;
            case "012":
                RetailerDataParser.parseRDTDataSegment2(fsList);
                break;
            case "013":
                RetailerDataParser.parseRDTDataSegment3(fsList);
                break;
            case "014":
                RetailerDataParser.parseRDTDataSegment4(fsList);
                break;
            case "021":
                CardSchemeParser.parseSegment1(fsList, database, partialDownload);
                break;
            case "022":
                CardSchemeParser.parseSegment2(fsList, database);
                break;
            case "023":
                CardSchemeParser.parseSegment3(fsList, database);
                break;
            case "031":
                if (partialDownload) {
                    MessageTextParser.updateMessageText(fsList, database);
                } else {
                    MessageTextParser.insertMessageText(fsList, database);
                }

                break;
            case "041":
                parsePublicKeySegment(fsList, database);
                break;
            case "051":
                TerminalConnectionParser.toSaveTerminalConnectionDetails(fsList);
                break;
            case "061":
                DeviceSpecificParser.toSaveDeviceSpecificDetails(fsList);
                break;
            case "071":
                AidListParser.toSaveAidListDetails(fsList);
                break;
            case "081":
                AIDDataParser.parseSegment1(fsList, database);
                break;
        }
    }

